ak7(a){return A.au(["appName",A.bO("Maze runner"),"description",A.bO("Bir canl\u0131, bir mac\u0259ra.\n\nOyun d\xfcnyas\u0131na \u0259n yeni \u0259lav\u0259 olan Maze Runner il\u0259 ba\u015fqa he\xe7 kimi olmayan bir s\u0259yah\u0259t\u0259 \xe7\u0131x\u0131n. Nam\u0259lum olan\u0131 k\u0259\u015ff etm\u0259y\u0259, \xf6z\xfcn\xfcz\u0259 meydan oxuma\u011fa v\u0259 h\u0259r s\u0259viyy\u0259d\u0259 yeni v\u0259 maraql\u0131 d\xfcnyalara da\u015f\u0131nma\u011fa haz\u0131r olun.\n\nMaze Runner-d\u0259 oyun\xe7ulara h\u0259r add\u0131mda t\u0259hl\xfck\u0259l\u0259r v\u0259 mane\u0259l\u0259rl\u0259 dolu labirintd\u0259 naviqasiya tap\u015f\u0131r\u0131\u011f\u0131 verilir. Yeralt\u0131 zindanlardan v\u0259 alovlu vulkanik ma\u011faralardan tutmu\u015f kosmos ekspedisiyalar\u0131na v\u0259 sualt\u0131 d\xfcnyalara q\u0259d\u0259r bu oyundak\u0131 s\u0259viyy\u0259l\u0259r ara\u015fd\u0131rmaq \xfc\xe7\xfcn m\xfcxt\u0259lif m\xfchitl\u0259r t\u0259klif edir. Ehtiyat etm\u0259k \xfc\xe7\xfcn yaln\u0131z bir h\u0259yat\u0131 olan oyun\xe7ular bacar\u0131qlar\u0131n\u0131 istifad\u0259 etm\u0259li v\u0259 n\u0259tic\u0259d\u0259 labirintd\u0259n qa\xe7mal\u0131d\u0131rlar.\n\nMaze Runner-\u0131n \u0259sas x\xfcsusiyy\u0259tl\u0259rind\u0259n biri m\xfcxt\u0259lif m\xfchitl\u0259r v\u0259 yerl\u0259rdir. Okean\u0131n d\u0259rinlikl\u0259rind\u0259n g\xfcn\u0259\u015fin s\u0259thin\u0259 q\u0259d\u0259r oyun sizi video oyununda rastla\u015faca\u011f\u0131n\u0131z \u0259n heyranedici m\u0259nz\u0259r\u0259l\u0259rd\u0259n b\u0259zil\u0259ri il\u0259 s\u0259yah\u0259t\u0259 \xe7\u0131xar\u0131r. H\u0259r bir s\u0259viyy\u0259 \xf6z\xfcn\u0259m\u0259xsus \xe7\u0259tinlikl\u0259r v\u0259 mane\u0259l\u0259r t\u0259klif edir ki, he\xe7 vaxt cans\u0131x\u0131c\u0131 olmayacaqs\u0131n\u0131z.\n\nH\u0259y\u0259can verici oyundan \u0259lav\u0259, Maze Runner h\u0259m d\u0259 heyr\u0259tamiz qrafika v\u0259 immersiv s\u0259s effektl\u0259ri il\u0259 \xf6y\xfcn\xfcr. Oyunun t\u0259f\u0259rr\xfcatl\u0131 m\xfchitl\u0259ri v\u0259 personajlar\u0131 canl\u0131 r\u0259ngl\u0259r v\u0259 hamar animasiyalarla canland\u0131r\u0131l\u0131r, s\u0259s effektl\u0259ri v\u0259 musiqi is\u0259 h\u0259m g\u0259rgin, h\u0259m d\u0259 h\u0259y\u0259canl\u0131 atmosfer yaratma\u011fa k\xf6m\u0259k edir.\n\nT\u0259hl\xfck\u0259 v\u0259 mac\u0259ra il\u0259 dolu bir d\xfcnya olan Maze Runner h\u0259r\u0259k\u0259tli, \xe7\u0259tin oyunu sev\u0259n h\u0259r k\u0259s \xfc\xe7\xfcn m\xfck\u0259mm\u0259l oyundur. B\u0259s siz n\u0259yi g\xf6zl\u0259yirsiniz? Bu g\xfcn Maze Runner-\u0131 y\xfckl\u0259yin v\u0259 son mac\u0259ra ya\u015fay\u0131n!")],t.N,t.Y)},
